        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "心拍変動、またの名をHRVとは、心臓の鼓動間の時間の変動を表します。つまり、心拍数は心臓が1分間に何回鼓動するかを測定するのに対し、HRVはそれらの鼓動の間の時間の変動です。"),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "あなたの心拍変動は、ストレスからうまく対処し回復できるかどうかの重要な指標であり、それは運動や病気などの身体的なストレス要因や、不安などの感情的および精神的なストレス要因であるかにかかわらずです。心拍変動を増やすことは、より良い睡眠、痛みの軽減、全体的な健康とフィットネスの向上を意味します。"),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "個別の心拍変動はあなたのHRVスコアで表されます。通常、HRVはミリ秒単位で測定され、より高いHRVスコアはより健康であることを示します。"),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "高いHRVスコアが健康の指標である理由を理解するには、心拍変動が自律神経系（またはANS）によって制御されていることを知っておく必要があります。自律神経系は無意識の体の機能を調節します（消化、血圧、呼吸、心拍など）、交感神経系（「戦闘または逃走モード」）と副交感神経系（「休息、消化、回復モード」）の2つの枝から成り立っています。"),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "交感神経系、一般的に「戦うか逃げるか」モードとして知られているものは、体が脅威を感知したときに無意識に活性化されます。身を守るために、体は交感神経系を利用して呼吸を促進し、血圧を上げ、コルチゾールなどのストレスホルモンを上昇させ、危険な状況で安全を保つために必要なすべてのエネルギーとリソースを確保します。"),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "副交感神経系、通称「休息と消化」モードは、リラックスした状態です。心拍数を減少させ、呼吸を遅くし、体をホメオスタシス（自然なバランス）に戻すことができます。副交感神経状態では、血流とエネルギーを再分配して睡眠、消化、繁殖などの回復機能に安全に感じます。"),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "したがって、心拍の間の時間の変動が大きい、いわゆる高いHRVスコアは、自律神経系が効率的に反応できることを意味し、ストレスの多い状況に対処するために交感神経系をオンにし、脅威が去ったときにはリラックスした副交感神経状態に切り替えることができます。"),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "強度と回復の評価：HRVをモニタリングすることで、個人は自身の体力疲労レベルと回復状態をより正確に把握できます。低いHRVは過度なトレーニングや不十分な回復を示す可能性があり、休息時間の増加や過度な負荷を避けるためにトレーニングプランの調整が必要になることがあります。"),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "心理ストレスと体力パフォーマンスの関連：持続的な心理的ストレスはHRVの低下につながり、スポーツパフォーマンスに影響を与える可能性があります。したがって、良好なHRVを維持することは最適な心理的および生理的状態に寄与し、それにより競技パフォーマンスを向上させます。"),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "要約すると、心拍変動は個々の運動ルーチンの指導、全体の健康状態のモニタリング、そしてスポーツパフォーマンスの予測において重要な役割を果たしています。HRVの変化を追跡および分析することで、個人はそのフィットネス計画について情報を得て科学的な判断を下すことができます。"),
        "workouts_detail_info_hrv_content_title1":
            MessageLookupByLibrary.simpleMessage("心拍変動とは何ですか？"),
        "workouts_detail_info_hrv_content_title2":
            MessageLookupByLibrary.simpleMessage("心拍変動はなぜ重要ですか？"),
        "workouts_detail_info_hrv_content_title3":
            MessageLookupByLibrary.simpleMessage("HRVスコアの意味は？"),
